sys_variable_value.value:
(function execute(inputs, outputs) {
    var grRecord = new GlideAggregate(inputs.tableName);
    
    // Validate field
    if (!grRecord.isValidField(inputs.fieldName)) {
        outputs.execution_result = "failed";
        outputs.error_message = "Invalid field name: " + inputs.fieldName;
        return;
    }

    // Add aggregate and group by the input field
    grRecord.addAggregate('COUNT', inputs.fieldName);
    grRecord.groupBy(inputs.fieldName);
    grRecord.query();

    var duplicateInfo = [];
    var hasDuplicates = false;

    while (grRecord.next()) {
        var count = grRecord.getAggregate('COUNT', inputs.fieldName);
        if (count > 1) {
            var obj = {};
            obj.field_value = grRecord.getValue(inputs.fieldName);
            obj.display_value = grRecord.getDisplayValue();
            obj.count = count;
            duplicateInfo.push(obj);
            hasDuplicates = true;
        }
    }

    outputs.duplicate_records = duplicateInfo;
    outputs.execution_result = hasDuplicates ? "success" : "no_duplicates_found";

})(inputs, outputs);

